import{_ as p}from"./plugin-vue_export-helper-c27b6911.js";import{o as e,c as t,e as _}from"./app-519c652a.js";const o={},a=_('<h1 id="机动车维修管理规定" tabindex="-1"><a class="header-anchor" href="#机动车维修管理规定" aria-hidden="true">#</a> 机动车维修管理规定</h1><p>(2005年6月24日交通部令第7号发布 根据2015年8月8日《交通运输部关于修改〈机动车维修管理规定〉的决定》第一次修正 根据2016年4月19日《交通运输部关于修改〈机动车维修管理规定〉的决定》第二次修正 根据2019年6月21日《交通运输部关于修改〈机动车维修管理规定〉的决定》第三次修正 根据2021年8月11日《交通运输部关于修改〈机动车维修管理规定〉的决定》第四次修正)</p><p>第一章 总  则</p><p>第一条 为规范机动车维修经营活动，维护机动车维修市场秩序，保护机动车维修各方当事人的合法权益，保障机动车运行安全，保护环境，节约能源，促进机动车维修业的健康发展，根据《中华人民共和国道路运输条例》及有关法律、行政法规的规定，制定本规定。</p><p>第二条 从事机动车维修经营的，应当遵守本规定。</p><p>本规定所称机动车维修经营，是指以维持或者恢复机动车技术状况和正常功能，延长机动车使用寿命为作业任务所进行的维护、修理以及维修救援等相关经营活动。</p><p>第三条 机动车维修经营者应当依法经营，诚实信用，公平竞争，优质服务，落实安全生产主体责任和维修质量主体责任。</p><p>第四条 机动车维修管理，应当公平、公正、公开和便民。</p><p>第五条 任何单位和个人不得封锁或者垄断机动车维修市场。</p><p>托修方有权自主选择维修经营者进行维修。除汽车生产厂家履行缺陷汽车产品召回、汽车质量&quot;三包&quot;责任外，任何单位和个人不得强制或者变相强制指定维修经营者。</p><p>鼓励机动车维修企业实行集约化、专业化、连锁经营，促进机动车维修业的合理分工和协调发展。</p><p>鼓励推广应用机动车维修环保、节能、不解体检测和故障诊断技术，推进行业信息化建设和救援、维修服务网络化建设，提高机动车维修行业整体素质，满足社会需要。</p><p>鼓励机动车维修企业优先选用具备机动车检测维修国家职业资格的人员，并加强技术培训，提升从业人员素质。</p><p>第六条 交通运输部主管全国机动车维修管理工作。</p><p>县级以上地方人民政府交通运输主管部门负责组织领导本行政区域的机动车维修管理工作。</p><p>县级以上道路运输管理机构负责具体实施本行政区域内的机动车维修管理工作。</p><p>第二章　经营备案</p><p>第七条 从事机动车维修经营业务的，应当在依法向市场监督管理机构办理有关登记手续后，向所在地县级道路运输管理机构进行备案。</p><p>道路运输管理机构应当按照《中华人民共和国道路运输条例》和本规定实施机动车维修经营备案。道路运输管理机构不得向机动车维修经营者收取备案相关费用。</p><p>第八条 机动车维修经营依据维修车型种类、服务能力和经营项目实行分类备案。</p><p>机动车维修经营业务根据维修对象分为汽车维修经营业务、危险货物运输车辆维修经营业务、摩托车维修经营业务和其他机动车维修经营业务四类。</p><p>汽车维修经营业务、其他机动车维修经营业务根据经营项目和服务能力分为一类维修经营业务、二类维修经营业务和三类维修经营业务。</p><p>摩托车维修经营业务根据经营项目和服务能力分为一类维修经营业务和二类维修经营业务。</p><p>第九条 一类、二类汽车维修经营业务或者其他机动车维修经营业务，可以从事相应车型的整车修理、总成修理、整车维护、小修、维修救援、专项修理和维修竣工检验工作；三类汽车维修经营业务（含汽车综合小修）、三类其他机动车维修经营业务，可以分别从事汽车综合小修或者发动机维修、车身维修、电气系统维修、自动变速器维修、轮胎动平衡及修补、四轮定位检测调整、汽车润滑与养护、喷油泵和喷油器维修、曲轴修磨、气缸镗磨、散热器维修、空调维修、汽车美容装潢、汽车玻璃安装及修复等汽车专项维修工作。具体有关经营项目按照《汽车维修业开业条件》（GB/T 16739）相关条款的规定执行。</p><p>第十条 一类摩托车维修经营业务，可以从事摩托车整车修理、总成修理、整车维护、小修、专项修理和竣工检验工作；二类摩托车维修经营业务，可以从事摩托车维护、小修和专项修理工作。</p><p>第十一条 危险货物运输车辆维修经营业务，除可以从事危险货物运输车辆维修经营业务外，还可以从事一类汽车维修经营业务。</p><p>第十二条 从事汽车维修经营业务或者其他机动车维修经营业务的，应当符合下列条件：</p><p>（一）有与其经营业务相适应的维修车辆停车场和生产厂房。租用的场地应当有书面的租赁合同，且租赁期限不得少于1年。停车场和生产厂房面积按照国家标准《汽车维修业开业条件》（GB/T 16739）相关条款的规定执行。</p><p>（二）有与其经营业务相适应的设备、设施。所配备的计量设备应当符合国家有关技术标准要求，并经法定检定机构检定合格。从事汽车维修经营业务的设备、设施的具体要求按照国家标准《汽车维修业开业条件》（GB/T 16739）相关条款的规定执行；从事其他机动车维修经营业务的设备、设施的具体要求，参照国家标准《汽车维修业开业条件》（GB/T 16739）执行，但所配备设施、设备应与其维修车型相适应。</p><p>（三）有必要的技术人员：</p><p>1.从事一类和二类维修业务的应当各配备至少1名技术负责人员、质量检验人员、业务接待人员以及从事机修、电器、钣金、涂漆的维修技术人员。技术负责人员应当熟悉汽车或者其他机动车维修业务，并掌握汽车或者其他机动车维修及相关政策法规和技术规范；质量检验人员应当熟悉各类汽车或者其他机动车维修检测作业规范，掌握汽车或者其他机动车维修故障诊断和质量检验的相关技术，熟悉汽车或者其他机动车维修服务收费标准及相关政策法规和技术规范，并持有与承修车型种类相适应的机动车驾驶证；从事机修、电器、钣金、涂漆的维修技术人员应当熟悉所从事工种的维修技术和操作规范，并了解汽车或者其他机动车维修及相关政策法规。各类技术人员的配备要求按照《汽车维修业开业条件》（GB/T 16739）相关条款的规定执行。</p><p>2.从事三类维修业务的，按照其经营项目分别配备相应的机修、电器、钣金、涂漆的维修技术人员；从事汽车综合小修、发动机维修、车身维修、电气系统维修、自动变速器维修的，还应当配备技术负责人员和质量检验人员。各类技术人员的配备要求按照国家标准《汽车维修业开业条件》（GB/T 16739）相关条款的规定执行。</p><p>（四）有健全的维修管理制度。包括质量管理制度、安全生产管理制度、车辆维修档案管理制度、人员培训制度、设备管理制度及配件管理制度。具体要求按照国家标准《汽车维修业开业条件》（GB/T 16739）相关条款的规定执行。</p><p>（五）有必要的环境保护措施。具体要求按照国家标准《汽车维修业开业条件》（GB/T 16739）相关条款的规定执行。</p><p>第十三条 从事危险货物运输车辆维修的汽车维修经营者，除具备汽车维修经营一类维修经营业务的条件外，还应当具备下列条件：</p><p>（一）有与其作业内容相适应的专用维修车间和设备、设施，并设置明显的指示性标志；</p><p>（二）有完善的突发事件应急预案，应急预案包括报告程序、应急指挥以及处置措施等内容；</p><p>（三）有相应的安全管理人员；</p><p>（四）有齐全的安全操作规程。</p><p>本规定所称危险货物运输车辆维修，是指对运输易燃、易爆、腐蚀、放射性、剧毒等性质货物的机动车维修，不包含对危险货物运输车辆罐体的维修。</p><p>第十四条 从事摩托车维修经营的，应当符合下列条件：</p><p>（一）有与其经营业务相适应的摩托车维修停车场和生产厂房。租用的场地应有书面的租赁合同，且租赁期限不得少于1年。停车场和生产厂房的面积按照国家标准《摩托车维修业开业条件》（GB/T 18189）相关条款的规定执行。</p><p>（二）有与其经营业务相适应的设备、设施。所配备的计量设备应符合国家有关技术标准要求，并经法定检定机构检定合格。具体要求按照国家标准《摩托车维修业开业条件》（GB/T 18189）相关条款的规定执行。</p><p>（三）有必要的技术人员：</p><p>1.从事一类维修业务的应当至少有1名质量检验人员。质量检验人员应当熟悉各类摩托车维修检测作业规范，掌握摩托车维修故障诊断和质量检验的相关技术，熟悉摩托车维修服务收费标准及相关政策法规和技术规范。</p><p>2.按照其经营业务分别配备相应的机修、电器、钣金、涂漆的维修技术人员。机修、电器、钣金、涂漆的维修技术人员应当熟悉所从事工种的维修技术和操作规范，并了解摩托车维修及相关政策法规。</p><p>（四）有健全的维修管理制度。包括质量管理制度、安全生产管理制度、摩托车维修档案管理制度、人员培训制度、设备管理制度及配件管理制度。具体要求按照国家标准《摩托车维修业开业条件》（GB/T 18189）相关条款的规定执行。</p><p>（五）有必要的环境保护措施。具体要求按照国家标准《摩托车维修业开业条件》（GB/T 18189）相关条款的规定执行。</p><p>第十五条 从事机动车维修经营的，应当向所在地的县级道路运输管理机构进行备案，提交《机动车维修经营备案表》（见附件1），并附送符合本规定第十二条、第十三条、第十四条规定条件的下列材料，保证材料真实完整：</p><p>（一）维修经营者的营业执照复印件；</p><p>（二）经营场地（含生产厂房和业务接待室）、停车场面积材料、土地使用权及产权证明等相关材料；</p><p>（三）技术人员汇总表，以及各相关人员的学历、技术职称或职业资格证明等相关材料；</p><p>（四）维修设备设施汇总表，维修检测设备及计量设备检定合格证明等相关材料；</p><p>（五）维修管理制度等相关材料；</p><p>（六）环境保护措施等相关材料。</p><p>第十六条 从事机动车维修连锁经营服务的，其机动车维修连锁经营企业总部应先完成备案。</p><p>机动车维修连锁经营服务网点可由机动车维修连锁经营企业总部向连锁经营服务网点所在地县级道路运输管理机构进行备案，提交《机动车维修经营备案表》，附送下列材料，并对材料真实性承担相应的法律责任：</p><p>（一）连锁经营协议书副本；</p><p>（二）连锁经营的作业标准和管理手册；</p><p>（三）连锁经营服务网点符合机动车维修经营相应条件的承诺书。</p><p>连锁经营服务网点的备案经营项目应当在机动车维修连锁经营企业总部备案经营项目范围内。</p><p>第十七条 道路运输管理机构收到备案材料后，对材料齐全且符合备案要求的应当予以备案，并编号归档；对材料不全或者不符合备案要求的，应当场或者自收到备案材料之日起5日内一次性书面通知备案人需要补充的全部内容。</p><p>第十八条 机动车维修经营者名称、法定代表人、经营范围、经营地址等备案事项发生变化的，应当向原办理备案的道路运输管理机构办理备案变更。</p><p>机动车维修经营者需要终止经营的，应当在终止经营前30日告知原备案机构。</p><p>第十九条 道路运输管理机构应当向社会公布已备案的机动车维修经营者名单并及时更新，便于社会查询和监督。</p><p>第三章　维修经营</p><p>第二十条 机动车维修经营者应当按照备案的经营范围开展维修服务。</p><p>第二十一条 机动车维修经营者应当将《机动车维修标志牌》（见附件2）悬挂在经营场所的醒目位置。</p><p>《机动车维修标志牌》由机动车维修经营者按照统一式样和要求自行制作。</p><p>第二十二条 机动车维修经营者不得擅自改装机动车，不得承修已报废的机动车，不得利用配件拼装机动车。</p><p>托修方要改变机动车车身颜色，更换发动机、车身和车架的，应当按照有关法律、法规的规定办理相关手续，机动车维修经营者在查看相关手续后方可承修。</p><p>第二十三条 机动车维修经营者应当加强对从业人员的安全教育和职业道德教育，确保安全生产。</p><p>机动车维修从业人员应当执行机动车维修安全生产操作规程，不得违章作业。</p><p>第二十四条 机动车维修产生的废弃物，应当按照国家的有关规定进行处理。</p><p>第二十五条 机动车维修经营者应当公布机动车维修工时定额和收费标准，合理收取费用。</p><p>机动车维修工时定额可按各省机动车维修协会等行业中介组织统一制定的标准执行，也可按机动车维修经营者报所在地道路运输管理机构备案后的标准执行，也可按机动车生产厂家公布的标准执行。当上述标准不一致时，优先适用机动车维修经营者备案的标准。</p><p>机动车维修经营者应当将其执行的机动车维修工时单价标准报所在地道路运输管理机构备案。</p><p>机动车生产、进口企业应当在新车型投放市场后六个月内，向社会公布其生产、进口机动车车型的维修技术信息和工时定额。具体要求按照国家有关部门关于汽车维修技术信息公开的规定执行。</p><p>第二十六条 机动车维修经营者应当使用规定的结算票据，并向托修方交付维修结算清单，作为托修方追责依据。维修结算清单中，工时费与材料费应当分项计算。维修结算清单应当符合交通运输部有关标准要求，维修结算清单内容应包括托修方信息、承修方信息、维修费用明细单等。</p><p>机动车维修经营者不出具规定的结算票据和结算清单的，托修方有权拒绝支付费用。</p><p>第二十七条 机动车维修经营者应当按照规定，向道路运输管理机构报送统计资料。</p><p>道路运输管理机构应当为机动车维修经营者保守商业秘密。</p><p>第二十八条 机动车维修连锁经营企业总部应当按照统一采购、统一配送、统一标识、统一经营方针、统一服务规范和价格的要求，建立连锁经营的作业标准和管理手册，加强对连锁经营服务网点经营行为的监管和约束，杜绝不规范的商业行为。</p><p>第四章　质量管理</p><p>第二十九条 机动车维修经营者应当按照国家、行业或者地方的维修标准规范和机动车生产、进口企业公开的维修技术信息进行维修。尚无标准或规范的，可参照机动车生产企业提供的维修手册、使用说明书和有关技术资料进行维修。</p><p>机动车维修经营者不得通过临时更换机动车污染控制装置、破坏机动车车载排放诊断系统等维修作业，使机动车通过排放检验。</p><p>第三十条 机动车维修经营者不得使用假冒伪劣配件维修机动车。</p><p>机动车维修配件实行追溯制度。机动车维修经营者应当记录配件采购、使用信息，查验产品合格证等相关证明，并按规定留存配件来源凭证。</p><p>托修方、维修经营者可以使用同质配件维修机动车。同质配件是指，产品质量等同或者高于装车零部件标准要求，且具有良好装车性能的配件。</p><p>机动车维修经营者对于换下的配件、总成，应当交托修方自行处理。</p><p>机动车维修经营者应当将原厂配件、同质配件和修复配件分别标识，明码标价，供用户选择。</p><p>第三十一条 机动车维修经营者对机动车进行二级维护、总成修理、整车修理的，应当实行维修前诊断检验、维修过程检验和竣工质量检验制度。</p><p>承担机动车维修竣工质量检验的机动车维修企业或机动车综合性能检测机构应当使用符合有关标准并在检定有效期内的设备，按照有关标准进行检测，如实提供检测结果证明，并对检测结果承担法律责任。</p><p>第三十二条 机动车维修竣工质量检验合格的，维修质量检验人员应当签发《机动车维修竣工出厂合格证》（见附件3）；未签发机动车维修竣工出厂合格证的机动车，不得交付使用，车主可以拒绝交费或接车。</p><p>第三十三条 机动车维修经营者应当建立机动车维修档案，并实行档案电子化管理。维修档案应当包括：维修合同（托修单）、维修项目、维修人员及维修结算清单等。对机动车进行二级维护、总成修理、整车修理的，维修档案还应当包括：质量检验单、质量检验人员、竣工出厂合格证（副本）等。</p><p>机动车维修经营者应当按照规定如实填报、及时上传承修机动车的维修电子数据记录至国家有关汽车维修电子健康档案系统。机动车生产厂家或者第三方开发、提供机动车维修服务管理系统的，应当向汽车维修电子健康档案系统开放相应数据接口。</p><p>机动车托修方有权查阅机动车维修档案。</p><p>第三十四条 道路运输管理机构应当加强机动车维修从业人员管理，建立健全从业人员信用档案，加强从业人员诚信监管。</p><p>机动车维修经营者应当加强从业人员从业行为管理，促进从业人员诚信、规范从业维修。</p><p>第三十五条 道路运输管理机构应当加强对机动车维修经营的质量监督和管理，采用定期检查、随机抽样检测检验的方法，对机动车维修经营者维修质量进行监督。</p><p>道路运输管理机构可以委托具有法定资格的机动车维修质量监督检验单位，对机动车维修质量进行监督检验。</p><p>第三十六条 机动车维修实行竣工出厂质量保证期制度。</p><p>汽车和危险货物运输车辆整车修理或总成修理质量保证期为车辆行驶20000公里或者100日；二级维护质量保证期为车辆行驶5000公里或者30日；一级维护、小修及专项修理质量保证期为车辆行驶2000公里或者10日。</p><p>摩托车整车修理或者总成修理质量保证期为摩托车行驶7000公里或者80日；维护、小修及专项修理质量保证期为摩托车行驶800公里或者10日。</p><p>其他机动车整车修理或者总成修理质量保证期为机动车行驶6000公里或者60日；维护、小修及专项修理质量保证期为机动车行驶700公里或者7日。</p><p>质量保证期中行驶里程和日期指标，以先达到者为准。</p><p>机动车维修质量保证期，从维修竣工出厂之日起计算。</p><p>第三十七条 在质量保证期和承诺的质量保证期内，因维修质量原因造成机动车无法正常使用，且承修方在3日内不能或者无法提供因非维修原因而造成机动车无法使用的相关证据的，机动车维修经营者应当及时无偿返修，不得故意拖延或者无理拒绝。</p><p>在质量保证期内，机动车因同一故障或维修项目经两次修理仍不能正常使用的，机动车维修经营者应当负责联系其他机动车维修经营者，并承担相应修理费用。</p><p>第三十八条 机动车维修经营者应当公示承诺的机动车维修质量保证期。所承诺的质量保证期不得低于第三十六条的规定。</p><p>第三十九条 道路运输管理机构应当受理机动车维修质量投诉，积极按照维修合同约定和相关规定调解维修质量纠纷。</p><p>第四十条 机动车维修质量纠纷双方当事人均有保护当事车辆原始状态的义务。必要时可拆检车辆有关部位，但双方当事人应同时在场，共同认可拆检情况。</p><p>第四十一条 对机动车维修质量的责任认定需要进行技术分析和鉴定，且承修方和托修方共同要求道路运输管理机构出面协调的，道路运输管理机构应当组织专家组或委托具有法定检测资格的检测机构作出技术分析和鉴定。鉴定费用由责任方承担。</p><p>第四十二条 对机动车维修经营者实行质量信誉考核制度。机动车维修质量信誉考核办法另行制定。</p><p>机动车维修质量信誉考核内容应当包括经营者基本情况、经营业绩（含奖励情况）、不良记录等。</p><p>第四十三条 道路运输管理机构应当采集机动车维修企业信用信息，并建立机动车维修企业信用档案，除涉及国家秘密、商业秘密外，应当依法公开，供公众查阅。机动车维修质量信誉考核结果、汽车维修电子健康档案系统维修电子数据记录上传情况及车主评价、投诉和处理情况是机动车维修信用档案的重要组成部分。</p><p>第四十四条 建立机动车维修经营者和从业人员黑名单制度，县级道路运输管理机构负责认定机动车维修经营者和从业人员黑名单，具体办法由交通运输部另行制定。</p><p>第五章　监督检查</p><p>第四十五条 道路运输管理机构应当加强对机动车维修经营活动的监督检查。</p><p>道路运输管理机构应当依法履行对维修经营者的监管职责，对维修经营者是否依法备案或者备案事项是否属实进行监督检查。</p><p>道路运输管理机构的工作人员应当严格按照职责权限和程序进行监督检查，不得滥用职权、徇私舞弊，不得乱收费、乱罚款。</p><p>第四十六条 道路运输管理机构应当积极运用信息化技术手段，科学、高效地开展机动车维修管理工作。</p><p>第四十七条 道路运输管理机构的执法人员在机动车维修经营场所实施监督检查时，应当有2名以上人员参加，并向当事人出示交通运输部监制的交通行政执法证件。</p><p>道路运输管理机构实施监督检查时，可以采取下列措施：</p><p>（一）询问当事人或者有关人员，并要求其提供有关资料；</p><p>（二）查询、复制与违法行为有关的维修台帐、票据、凭证、文件及其他资料，核对与违法行为有关的技术资料；</p><p>（三）在违法行为发现场所进行摄影、摄像取证；</p><p>（四）检查与违法行为有关的维修设备及相关机具的有关情况。</p><p>检查的情况和处理结果应当记录，并按照规定归档。当事人有权查阅监督检查记录。</p><p>第四十八条 从事机动车维修经营活动的单位和个人，应当自觉接受道路运输管理机构及其工作人员的检查，如实反映情况，提供有关资料。</p><p>第六章　法律责任</p><p>第四十九条 违反本规定，从事机动车维修经营业务，未按规定进行备案的，由县级以上道路运输管理机构责令改正；拒不改正的，处5000元以上2万元以下的罚款。</p><p>第五十条 违反本规定，从事机动车维修经营业务不符合国务院交通运输主管部门制定的机动车维修经营业务标准的，由县级以上道路运输管理机构责令改正；情节严重的，由县级以上道路运输管理机构责令停业整顿。</p><p>第五十一条 违反本规定，机动车维修经营者使用假冒伪劣配件维修机动车，承修已报废的机动车或者擅自改装机动车的，由县级以上道路运输管理机构责令改正；有违法所得的，没收违法所得，处违法所得2倍以上10倍以下的罚款；没有违法所得或者违法所得不足1万元的，处2万元以上5万元以下的罚款，没收假冒伪劣配件及报废车辆；情节严重的，由县级以上道路运输管理机构责令停业整顿；构成犯罪的，依法追究刑事责任。</p><p>第五十二条 违反本规定，机动车维修经营者签发虚假机动车维修竣工出厂合格证的，由县级以上道路运输管理机构责令改正；有违法所得的，没收违法所得，处以违法所得2倍以上10倍以下的罚款；没有违法所得或者违法所得不足3000元的，处以5000元以上2万元以下的罚款；情节严重的，由县级以上道路运输管理机构责令停业整顿；构成犯罪的，依法追究刑事责任。</p><p>第五十三条 违反本规定，有下列行为之一的，由县级以上道路运输管理机构责令其限期整改：</p><p>（一）机动车维修经营者未按照规定执行机动车维修质量保证期制度的；</p><p>（二）机动车维修经营者未按照有关技术规范进行维修作业的；</p><p>（三）伪造、转借、倒卖机动车维修竣工出厂合格证的；</p><p>（四）机动车维修经营者只收费不维修或者虚列维修作业项目的；</p><p>（五）机动车维修经营者未在经营场所醒目位置悬挂机动车维修标志牌的；</p><p>（六）机动车维修经营者未在经营场所公布收费项目、工时定额和工时单价的；</p><p>（七）机动车维修经营者超出公布的结算工时定额、结算工时单价向托修方收费的；</p><p>（八）机动车维修经营者未按规定建立机动车维修档案并实行档案电子化管理，或者未及时上传维修电子数据记录至国家有关汽车维修电子健康档案系统的。</p><p>第五十四条 违反本规定，道路运输管理机构的工作人员有下列情形之一的，由同级地方人民政府交通运输主管部门依法给予行政处分；构成犯罪的，依法追究刑事责任：</p><p>（一）不按照规定实施备案和黑名单制度的；</p><p>（二）参与或者变相参与机动车维修经营业务的；</p><p>（三）发现违法行为不及时查处的；</p><p>（四）索取、收受他人财物或谋取其他利益的；</p><p>（五）其他违法违纪行为。</p><p>第七章　附  则</p><p>第五十五条 本规定自2005年8月1日起施行。经商国家发展和改革委员会、国家工商行政管理总局同意，1986年12月12日交通部、原国家经委、原国家工商行政管理局发布的《汽车维修行业管理暂行办法》同时废止，1991年4月10日交通部颁布的《汽车维修质量管理办法》同时废止。</p>',152),c=[a];function r(n,s){return e(),t("div",null,c)}const d=p(o,[["render",r],["__file","机动车维修管理规定.html.vue"]]);export{d as default};
